import React, { useEffect,useState } from "react";
import axios from "axios";
import Statics from "./Statics";
import ShowApis from "./ShowApis";
const Dashboard = () => {
  const [apis, setapis] = useState([]);
  const [user, setuser] = useState([]);
  const [show,setshow]=useState('statics')
useEffect(()=>{
  axios
  .get(`${process.env.REACT_APP_BACKEND}/getapi`)
  .then((res) => {
    setapis(res.data);
  })
  .catch((err) => {
    console.log(err);
  });
  axios
  .get(`${process.env.REACT_APP_BACKEND}/getuser`)
  .then((res) => {
    setuser(res.data);
  })
  .catch((err) => {
    console.log(err);
  });
},[])

  return (
    <>
      {show==='statics' && <Statics apis={apis} user={user}></Statics>}
      {show==='api' && <ShowApis apis={apis}></ShowApis>}
    </>
  );
};

export default Dashboard;
